import React from "react";

const main = () => {
  return (
    <div className="  h-96 bg-white ">
      <div className="flex justify-center">
        <h1 className="text-4xl font-bold">EDUCATION</h1>
      </div>

      <div className="flex">
        <div className="bg-red-400 h-16 md:1/3">hello</div>
        <div className="bg-yellow-400 h-16 md:1/3">hello</div>
        <div className="bg-blue-400 h-16 md:1/3">hello</div>
      </div>
    </div>
  );
};

export default main;
